import React from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
import Navbar from './components/Navbar';
import Slider from './components/Slider';

function App() {

var details = {
  username:"Faizan",
  projectName:'My Cake'
}

  return (
    <div className="App">
    <Navbar  details = {details} />
    <Slider />
    </div>
  );
}

export default App;
